import React from "react";

export class SignUpComponent extends React.PureComponent{
    render(){
        return(
            <>
                <div className="register_div">
                    <form className="register_form">
                        <div className="form-group" id="first_group">
                            {/* <label htmlFor="firstName">First Name</label> */}
                            <input type="text" placeholder="First Name"  title="Enter username or email" autoComplete="false"  className="form-control" id="firstName"/>
                            {/* <label htmlFor="lastName">Last Name</label> */}
                            <input type="text" p title="Enter username or email" autoComplete="false"  className="form-control" id="lastName"/>
                            {/* <label htmlFor="inputEmail">Email</label> */}
                            <input type="text" title="Enter username or email" autoComplete="false"  className="form-control" id="inputEmail"/>
                        </div>
                        <div className="form-group" id="second_group">
                            <label htmlFor="inputUsername">Username</label>
                            <input type="text" title="Enter username or email" autoComplete="false"  className="form-control" id="inputUsername"/>
                            <label htmlFor="inputPassword">Password</label>
                            <input type="password" className="form-control" autoComplete="false" id="inputPassword"></input>
                            <label htmlFor="confirmPassword">Confirm</label>
                            <input type="password" className="form-control" autoComplete="false" id="confirmPassword"></input>
                        </div>
                    </form>
                </div>
            </>
        )
    }
}
